import base64

# The PDF content is base64 encoded, so we need to decode it
pdf_base64_content = ""

# Decoding the base64 content
pdf_content = base64.b64decode(pdf_base64_content)

# Saving the decoded PDF content to a file
pdf_file_path = './report306.pdf'
with open(pdf_file_path, 'wb') as pdf_file:
    pdf_file.write(pdf_content)
pdf_file_path
